export default function HomePage() {
  return (
    <div>
      <h1>Welcome to our digital design Gallery !</h1>
      <p>
        We are excited to share with you a diverse range of designs, including
        visual identities, digital graphics, product designs, and UX/UI work.
        This exhibition showcases the creativity and talent of our designers,
        and we hope it inspires you to think about the role that design plays in
        our daily lives. We hope you enjoy your visit and take away new ideas
        and insights into the world of digital design.
      </p>
    </div>
  );
}
